import React from 'react';
import Loading from './Components/Loading';
import styled from 'styled-components';

class App extends React.Component{
  render(){
    return(
      <Container>
        <Loading/>
      </Container>
    )
  }
}

export default App;

const Container = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  alight-items: center;
`;
